04haxelow/example.html.body:
Example
Write to a simple json database...
Done in Haxe
How to start
Create a folder named foobar (please use a better name; any name will do) and create folders bin and src.
See example below:
+ foobar
    + src
        - Main.hx
    - build.hxml
Install
Check out the installation.
The Main.hx
Open your favorite editor, copy/paste the code and save it in the src folder.
package ;

class Main {
    function new() {
        trace("C# Haxelow Example");

        // Create the database
        var db = new HaxeLow('db.json');

        // Get a collection of a class
        var persons = db.col(Person);

        // persons is now an Array
        // that can be manipulated as you like
        persons.push(new Person("Test", 50));

        // Save all collections to disk.
        // This is the only way to save, no automatic saving
        // takes place.
        db.save();

        trace("open /out/bin/db.json");
    }

    static public function main() {
        var main = new Main();
    }
}

class Person {
    public function new(name, age) {
        this.name = name;
        this.age = age;
    }

    public var name : String;
    public var age : Int;
}
